bio:
Я — один из редчайших IT директоров c ярко выраженной личной потребностью достижения конечного результата в каждом проекте. Обладаю стратегическим мышлением и способностью «видеть лес за деревьями». Моя главная отличительная черта — УНИВЕРСАЛЬНОСТЬ при постоянном обогащении знаний и подтверждения полученных навыков в значимых для управления IT (и цифровизации) направлениях:
●	управление IT: диплом MBA «Информационный менеджмент (CIO)» и международный сертификат CIO IAC и «Руководитель цифровой трансформации» (РАНХиГС);
●	цифровизация: «Управление цифровой трансформацией» (АНО ВО «Университет Иннополис»);
●	информационная безопасность: «Руководитель службы информационной безопасности и защиты от хакерских атак» (УЦ «Специалист» УНЦ при МГТУ им Н.Э. Баумана);
●	оркестрация разработки ПО: «Kubernetes + Gitlab (CI/CD)» (УЦ ООО «Слёрм». Технологии: Kubernetes, Gitlab (CI/CD), Docker, Ansible, Ceph).

С одной стороны, я прошел путь от рядового разработчика на платформе 1С: Предприятие до руководителя направления разработки (и внедрения) ERP-систем с зоной функциональной ответственности федерального масштаба. С другой, совершенствовал свои знания в области IT-инфраструктуры и достиг уровня сертифицированного системного инженера Microsoft (MCSE).

При всех достижениях в области управлении IT, мне нравится постоянно совершенствоваться на практике (зачастую «работать руками»): в данный момент обладаю дипломами «Разработчик C++ уровень Мастер» и «Разработчик Web-приложений на языке Go».

Как итог, мои главные компетенции — это знание правильного ответа на вопрос: «Как трансформировать IT-функцию в один из ключевых драйверов развития бизнеса?».

Быстро связаться со мной можно в Telegram: @Boris_CIO или по тел.: +7 (919) 433-08-72
#opentowork #lookingfornewopportunities

